import React,{Component} from 'react'
import axios from 'axios'

export class AddEntryPage extends Component{
  constructor(props){
    super(props);
    this.state = {
    name:'',
    itemName:'',
    itemPrice:0.0,
    itemLink:''
    }
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  handleChange = event => {
    this.setState({...this.state,[e.target.name]:e.target.value})
  }
  handleSubmit = event =>{
    event.preventDefault();

    const input = {
      name:this.state.name,
      itemName:this.state.itemName,
      itemPrice:this.state.itemPrice,
      itemLink:this.state.itemLink
    };
    console.log(input)
    axios.post('http://localhost:8000/list/addEntry',{input}).then(res=>{
      console.log(res);
      console.log(res.data);
    })
  }
  render(){
    return (
    <div class="vh-100 bg-secondary text-center">
      <form onSubmit={this.handleSubmit}>
        <label for="NameInput" class="form-label fw-bold text-capitalize fs-4">Name</label>
        <div class="d-flex justify-content-center">
          <input name='name' type="name" class="form-control w-25" id="name" placeholder="Name" onChange={this.handleChange}></input>
        </div>

        <label for="ItemNameInput" class="form-label fw-bold text-capitalize fs-4">Item Name</label>
        <div class="d-flex justify-content-center">
          <input name='itemName' type="name" class="form-control w-25" id="itemName" placeholder="Item Name" onChange={this.handleChange}></input>
        </div>

        <label for="ItemPriceInput" class="form-label fw-bold text-capitalize fs-4">Item Price</label>
        <div class="d-flex justify-content-center">
          <input name='itemPrice' type="name" class="form-control w-25" id="itemPrice" placeholder="Item Price" onChange={this.handleChange}></input>
        </div>

        <label for="ItemLinkInput" class="form-label fw-bold text-capitalize fs-4">Item Link</label>
        <div class="d-flex justify-content-center">
          <input name='itemLink' type="name" class="form-control w-25" id="itemLink" placeholder="Item Link" onChange={this.handleChange}></input>
        </div>
        <div class="d-flex justify-content-center">
        <button type="submit" class="btn btn-primary mt-2">Add Item</button>
        </div>
      </form>  
    </div>
  )
  }
}
export default AddEntryPage
